script: |
  super -f text -I q657.spq | sort > q657.out

inputs:
  - name: q657.spq
    data: |
      SELECT DISTINCT - - 52 / + ( + col0 ) AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col1 BETWEEN col1 * + col1 + col2 AND NULL;
  - name: tab0

outputs:
  - name: q657.out
    data: |
      0
      3
